import React from 'react';
import { Actions } from './Actions';
import { KeyResults } from './KeyResults';
import { PerformanceDate } from './PerformanceDate';

const Performance =()=>{
    return(
        //Use fragment instead of div
        <div>
        <>
            <PerformanceDate/>
            <KeyResults/>            
            </>
        <>
        <Actions/>
        </>
        </div>            
    );

}

export default Performance;
